import About from "../../pages/About";
import Post
	from "../../pages/Post";
import PostIdPage from "../../pages/PostIdPage";

export const routes = [
	{
		path: '/about',
		element: <About />,
		exact: true
	},
	{
		path: '/post',
		element: <Post />,
		exact: true
	},
	{
		path: '/about/:id',
		element: <PostIdPage />,
		exact: true
	}
]
